import React, { FC } from 'react';

interface NavigationProps {
    link1: string;
    link2: string;
    link3: string;
    link4: string;
}

const Navigation: FC<NavigationProps> = ({ link1, link2, link3, link4 }) => {
  return (
    <nav className="flex-row bg-slate-300 relative container p-6 justify-between mx-auto underline text-3x1">
      <h1><a href="resume.pdf" download>{link1}</a></h1>
      <h1>{link2}</h1>
      <h1>{link3}</h1>
      <h1>{link4}</h1>
    </nav>
  );
};

export default Navigation;
